import React from 'react';
import LoadingComponent from 'Components/ComponentLoading';
import Loadable from 'react-loadable';


// 定义
const SpareDefinePage = Loadable({
  loader: () => import('layouts/SparepartsManage/SpareDefinePage'),
  loading: LoadingComponent
});
// 库存
const StockPage = Loadable({
  loader: () => import('layouts/SparepartsManage/StockPage'),
  loading: LoadingComponent
});
// 库存
const StockWarning = Loadable({
  loader: () => import('layouts/SparepartsManage/StockWarning'),
  loading: LoadingComponent
});



export {
  SpareDefinePage, StockPage, StockWarning
};
